import React from "react";
import "../css/offer.css";

const Offer = (props) => {
  return (
      <div className="offer">
       <p className="number">{props.number}</p>
       <div className="offer-info">
       <h5>{props.title}</h5>
       <img src={props.image} alt="pricing-image" />
       </div>
      </div>
  );
};

export default Offer;
